import React, { Component } from 'react';

class Youtube extends Component {
    constructor() {
        super();
        var tag = document.createElement('script');
        tag.src = "https://www.youtube.com/iframe_api"

    }
    render() {
        return(
            <div>
                <h3> Youtube </h3>
            </div>
        )
    }
}

export default Youtube
